import React from "react";
import styles from "./Header.module.css";
import logo from './meals.jpg'

const Header = () => {
  return (
    <div>
      <div className={styles.Header}>
          <h2>ReactMeals</h2>
      </div>
      <div className={styles["main-image"]}>
      <img alt="homeImage" src={logo} />
      </div>
    </div>
  );
};

export default Header;
